import React, { useState, useEffect } from "react";
import { getFiles } from "../services/fileServices"

const FilePage = () => {
  //States
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [files, setFiles] = useState(null);
  const [search, setSearch] = useState(null);

  const getAllFiles = async () => {
    console.log("ajs")
    setLoading(true);
    try {
      const files = await getFiles(search);
      setLoading(false);
      setFiles(files);
    }
    catch (e) {
      console.log(`[File Page] error fetching files`, e);
      setLoading(false);
      setError(e?.data ?? "Something went wrong");
    }
  };

  let cleanup = false;
  (async () => {
    try {
      setProcessing(true);
      const result = await getEstimatedPriceAndMarketIndexes({
        truck_origin: data?.truck_origin__view?.metadata,
        origin: data?.origin__view?.metadata,
        destination: data?.destination__view?.metadata,
        miles: loadedMiles,
        distance_to_origin: emptyMiles,
        carrier: data?.truck__view?.metadata?.carrier,
        equipment: data?.truck__view?.metadata?.equipment,
        truck: data?.truck,
      });

      if (cleanup) return;
      const avg = result?.estimated?.est_price ? result?.estimated?.est_price?.toFixed(0) : null;
      const min = result?.estimated?.min_price ? result?.estimated?.min_price?.toFixed(0) : null;
      const max = result?.estimated?.max_price ? result?.estimated?.max_price?.toFixed(0) : null;
      setEstRate({ avg, min, max, error: null });
      setProcessing(false);
    } catch (e) {
      const message = e?.errors?.[0]?.message ?? e?.message;
      console.error("[CalculatorLoadView] failed to process rate =>", message);
      setEstRate({ avg: -1, min: -1, max: -1, error: "Failed to estimate" });
      setProcessing(false);
    }
    dirty.current.estRate = false;
  })();

  return () => {
    cleanup = true;
  };
  useEffect(() => {
    let cleanup = false;
    getAllFiles();
    if (cleanup) return;
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  // useEffect(() => {
  //   // not call this function when the search is not active
  //   if (!search) return;
  //   const handler = setTimeout(() => {
  //     getAllFiles();
  //   }, 700);

  //   return () => {
  //     clearTimeout(handler);
  //   };
  // }, [search]);

  const onChange = (e) => {
    setSearch(e.target.value);
  };

  if (error) {
    return (
      <div class="text-center text-danger">
        {error}
      </div>
    )
  };

  return (
    <div className="p-4">
      <input
        type="string"
        id="search"
        onChange={onChange}
        placeholder="Search by File name"
        className="mb-3 bg-gray-50 border border-gray-500 text-gray-900 rounded-lg w-full p-2.5"
      />

      {loading &&
        <div className="d-flex justify-content-center w-full position-absolute top-50 start-50">
          <div className="spinner-border" role="status">
          </div>
        </div>
      }

      <table className="table table-bordered">
        <thead>
          <tr>
            <th scope="col">File Name</th>
            <th scope="col">Text</th>
            <th scope="col">Number</th>
            <th scope="col">Hex</th>
          </tr>
        </thead>
        <tbody>
          {files?.length > 0 &&
            files?.map((file => {
              return file?.lines.map((line, index) => {
                return (
                  <tr key={index}>
                    <th scope="row">{file?.file}</th>
                    <th scope="row">{line?.text}</th>
                    <th scope="row">{line?.number}</th>
                    <th scope="row">{line?.hex}</th>
                  </tr>
                )
              })
            }))
          }
        </tbody>
      </table>
    </div>
  )

}

export default FilePage;
